// import logo from './logo.svg';
import './App.css';
import {Route,BrowserRouter as Router} from 'react-router-dom'

import Home from './components/Home';

function App() {
  return (
    <div className="App">
      <h1>Home page</h1>
      <Router>
        <Route exact path="/" Component={Home}></Route>
        <Route path="/home" Component={Home}></Route>
      </Router>
    </div>
  );
}

export default App;
